import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import { NavLink } from "react-router-dom";
import "./index.css";

const Navbar = () => {
    return(
      <div className="col-lg-10 mx-auto">
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <a className="navbar-brand" to="#">Thapa Technical</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" 
          aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNavDropdown">
            <ul className="navbar-nav float-right d-flex ml-auto">
              <li className="nav-item">
                <NavLink className="nav-link " activeClassName="clicked" aria-current="page" to="/">Home</NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link link_active" activeClassName="clicked" to="/About">About</NavLink>
              </li>
              <li className="nav-item">
                <NavLink className="nav-link clicked" activeClassName="clicked" to="/Service">Service</NavLink>
              </li>   
              <li className="nav-item">
                <NavLink className="nav-link" activeClassName="clicked" to="/Contact">Contact</NavLink>
              </li>              
            </ul>
          </div>
        </div>
      </nav>
      </div>
    );
};

export default Navbar;
